<br>

<br>
レザーと異素材を掛け合わせる斬新なデザインを主とした、新進気鋭の日本ブランド。<br><br>


皮革だけにとらわれない幅広い発想で、<br>
デザイン性の高いアイテムを次々に世に送り出す。<br>

イママデではなく、コレカラを創造するデザイナーの志に注目が集まる。<br>
<br>



インナーカラーに流行のネオンカラーを採用。<br>

パッと華やいだ色味が、気持ちも晴れやかにしてくれます。<br>
<br>


札入れやカードポケット、ジップポケットも付いているので、<br>

キーケースだけではなくコンパクトウォレットとしても使えます。<br><br>



デザイン性と機能性が融合した、斬新かつ使い心地の良いハイクオリティな商品です。<br>
<br>


